import React from 'react'


const List =(props)=> {
  return (
    <ul>
      {props.list.map((item)=>(
        <Item key={item.objectID} item={item}/>
      ))}
  </ul>
  )
}
const Item = (props)=>(
<li>
  <span>
    <a href={props.item.url}>{props.item.title}</a>
  </span>
  <span>{props.item.author}</span>
  <span>{props.item.num_comments}</span>
  <span>{props.item.points}</span>
</li>
);


export default List;
